records.addlTxt:
Defendant Jared F Stromme in court, in custody, with attorney J Anthony Rosario.   Jayne Davis Dewire appeared for the State of Wisconsin. Defendant had entered a guilty plea as to count 1 on 11/24/2014, but had entered into the drug treatment court, but has failed in the drug treatment court and is being sentenced as to count 1. 

  The Defendant was sentenced to the following:

IMPOSED SENTENCE of: 

5 YEARS IMPRISONMENT 
  -  3  YEAR(S) OF INITIAL CONFINEMENT
  -  2 YEAR(S) OF EXTENDED SUPERVISION;

CONDITIONS OF EXTENDED SUPERVISION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain employment
*No contact with any of the businesses involved
*DNA sample to be provided if not yet previously done.

RESTITUTION:  $57.00 to Record Head, $379.98 to Target, $408.00 to Chase Bank, $350 to City Bank (to be paid as a condition of extended supervision - restitution to be paid before costs or fines);

COURT COSTS:  $268.00 (to be paid as a condition of extended supervision);

Defendant is eligible for Challenge Incarceration Program.
Defendant is eligible for Substance Abuse Program.

Felony warnings, voting rights and firearms warnings given. 

Attorney has 15 days to submit in writing any credit day that are owed.
